import React, { Component } from 'react';
import axios from 'axios';

class Plants extends Component {
  state = { plants: [] }
  componentDidMount() {
    this.fetchPlants()
  }
  fetchPlants = () => {
    axios.get('/plants.json')
    .then(response => this.setState({ plants: response.data }))
  }
  render() {
    const { plants } = this.state;
    return (
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Light</th>
            <th>Care</th>
            <th colSpan="3"></th>
          </tr>
        </thead>
        <tbody>
          {
            plants.map(plant => (
            <tr>
              <td>{plant.name}</td>
              <td>{plant.light}</td>
              <td>{plant.maintenance}</td>
            </tr>
            ))
          }
        </tbody>
      </table>
    )
  }
}

export default Plants;
